import React from 'react';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import DashboardIcon from '@material-ui/icons/Dashboard';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';
import PeopleIcon from '@material-ui/icons/People';
import BarChartIcon from '@material-ui/icons/BarChart';
import LayersIcon from '@material-ui/icons/Layers';
import AssignmentIcon from '@material-ui/icons/Assignment';
import PermIdentityIcon from '@material-ui/icons/PermIdentity';
import ExitToAppIcon from '@material-ui/icons/ExitToApp';
import CssBaseline from '@material-ui/core/CssBaseline';
import { createMuiTheme, ThemeProvider } from '@material-ui/core/styles';
import PFDinRegularWoff from "../fonts/PFDinTextCondPro-Regular.woff"

const pfdinRegular = {
  fontFamily: 'PFDinTextCondPro-Regular',
  fontStyle: 'normal',
  fontWeight: 'normal',
  src: `
    local('PFDinTextCondPro-Regular'),
    url(${PFDinRegularWoff}) format('woff')
    `,
}

const theme = createMuiTheme({
  typography: {
    fontFamily: 'PFDinTextCondPro-Regular',
    fontSize: 30
  },
  overrides: {
    MuiCssBaseline: {
      '@global': {
        '.MuiTypography-root': {
          fontSize: 30,
          fontFamily: 'PFDinTextCondPro-Regular',
        }
      },
    },
  },
});

const flexContainer = {
  display: 'flex',
  flexDirection: 'column',
  justifyContent:"center",
  padding: 0,
  margin: 'auto',
  color: "#FFF",
};

const listIcon ={
  color: "#FFF",
  justifyContent: 'center',
};

export const mainListItems = (
  <div>
    <ThemeProvider theme={theme}>
    <CssBaseline />
      <ListItem button style={flexContainer}>
        <ListItemIcon style={listIcon}>
          <DashboardIcon />
        </ListItemIcon>
        <ListItemText primary="Россети" multiline/>
      </ListItem>
      <ListItem button style={flexContainer}>
        <ListItemIcon style={listIcon}>
          <PermIdentityIcon />
        </ListItemIcon>
        <ListItemText primary="Кабинет" />
      </ListItem>
    </ThemeProvider>
  </div>
);

export const secondaryListItems = (
  <div>
    {/* <ListSubheader inset>Saved reports</ListSubheader> */}
    {/* <MuiThemeProvider theme={theme}> */}
      <ListItem button style={flexContainer}>
        <ListItemIcon style={listIcon}>
          <ExitToAppIcon />
        </ListItemIcon>
        <ListItemText primary="Выход" />
      </ListItem>
    {/* </MuiThemeProvider> */}
  </div>
);
